import { useEffect } from 'react';

const ScriptImporter = (resourceUrl) => {
  useEffect(() => {
    const script = document.createElement('script');
    script.src = resourceUrl;
    script.async = true;
    document.body.appendChild(script);
  }, []);
};

export default ScriptImporter;
